// DOM Elements
const heavyContainer = document.getElementById('heavy-container');
const lightContainer = document.getElementById('light-container');
const toolsContainer = document.getElementById('tools-container');

// Function to create equipment card
function createPropertyCard(equipment) {
    const card = document.createElement('div');
    card.className = 'property-card';
    
    card.innerHTML = `
        <img src="${equipment.image}" alt="${equipment.title}" class="property-image">
        <div class="property-info">
            <h3>${equipment.title}</h3>
            <div class="property-price">₹${equipment.price.toLocaleString()}/day</div>
            <div class="property-details">
                <span class="property-features">
                    <i class="fas fa-tag"></i> ${equipment.category.charAt(0).toUpperCase() + equipment.category.slice(1)}
                </span>
                <span class="property-features">
                    <i class="fas fa-calendar-check"></i> ${equipment.availability.charAt(0).toUpperCase() + equipment.availability.slice(1)}
                </span>
            </div>
            <div class="property-features">
                ${equipment.features.map(feature => `<span class="feature-tag">${feature}</span>`).join(' ')}
            </div>
            <div class="specifications">
                <h4>Specifications:</h4>
                <ul>
                    ${Object.entries(equipment.specifications).map(([key, value]) => 
                        `<li><strong>${key.charAt(0).toUpperCase() + key.slice(1)}:</strong> ${value}</li>`
                    ).join('')}
                </ul>
            </div>
        </div>
    `;
    
    return card;
}

// Function to display equipment by category
function displayEquipmentByCategory() {
    // Clear containers
    heavyContainer.innerHTML = '';
    lightContainer.innerHTML = '';
    toolsContainer.innerHTML = '';

    // Filter and display equipment by category
    rentalEquipment.forEach(equipment => {
        const card = createPropertyCard(equipment);
        switch(equipment.category) {
            case 'heavy':
                heavyContainer.appendChild(card);
                break;
            case 'light':
                lightContainer.appendChild(card);
                break;
            case 'tools':
                toolsContainer.appendChild(card);
                break;
        }
    });
}

// Initial display
displayEquipmentByCategory();

// Add smooth scrolling for navigation links
document.querySelectorAll('a[href^="#"]').forEach(anchor => {
    anchor.addEventListener('click', function (e) {
        e.preventDefault();
        const targetId = this.getAttribute('href').substring(1);
        const targetElement = document.getElementById(targetId);
        
        if (targetElement) {
            targetElement.scrollIntoView({
                behavior: 'smooth'
            });

            // Update active state in navigation
            document.querySelectorAll('.nav-links a').forEach(link => {
                link.classList.remove('active');
            });
            this.classList.add('active');
        }
    });
}); 